// SPDX-License-Identifier: MIT
// Tells the Solidity compiler to compile only from v0.8.13 to v0.9.0
pragma solidity ^0.8.13;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "./RailRoadCard.sol";

contract RailRoadTicket is Ownable, ERC721Enumerable{
    using SafeMath for uint256;
	using Counters for Counters.Counter;
	enum TICKET_TYPE {
		TRAIN,
		BUS,
		SUBWAY
	}
	struct Ticket {
		TICKET_TYPE ticketType;
	}
	Counters.Counter private _nextTokenId;
	uint public constant TICKET_PRICE = 0.069 ether;
	uint public constant MAX_TICKET_BUY_PER_TRANSAC = 10;
	mapping (uint256 => Ticket) private tickets;

	constructor() ERC721("RailRoadTicket","SRRT") {
	}

	function _mintNft(TICKET_TYPE ticketType) private {
		uint tokenId = _nextTokenId.current();
		_nextTokenId.increment();
		tickets[tokenId] = Ticket (ticketType);
		_safeMint(msg.sender,tokenId);
	}

	function buyTickets(RailRoadCard railRoadCardInstance,uint count,TICKET_TYPE ticketType,uint askedReduction) payable public {
		require( count > 0, "Should buy at least 1 ticket");
		require(railRoadCardInstance.getReduction(msg.sender) == askedReduction, "Wrong asked reduction");
		require(count <= MAX_TICKET_BUY_PER_TRANSAC, "Can't buy more than 10 tickets at a time" );
		uint totalPrice = TICKET_PRICE.mul(count) ;
		uint reductionAmount = totalPrice * askedReduction / 100; // Calcul de la rduction en pourcentage du prix total
		uint finalPrice = totalPrice - reductionAmount; // Calcul du prix final en soustractant 
		require(msg.value >= finalPrice, "Not enougth eth");
        for (uint i = 0; i < count; i++) {
          _mintNft(ticketType);
        }
		payable(owner()).transfer(msg.value);
	}

	 function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
		uint256 batchSize
    ) internal override virtual {
		// allow only mint transfer
        require(from == address(0), "Cannot transfer tickets");
		super._beforeTokenTransfer(from,to,tokenId,batchSize);
    }

	function getOwnedTickets() view public returns(Ticket[] memory) {
		address owner = msg.sender;
		uint ownedTokenIds = ERC721.balanceOf(owner);
		Ticket[] memory ownedTickets = new Ticket[](ownedTokenIds); 
		for (uint i =0; i< ownedTokenIds; i++){
			uint256 ownedTokenId = tokenOfOwnerByIndex(owner,i);
			Ticket memory ownedTicket = tickets[ownedTokenId];
			ownedTickets[i] = ownedTicket;
		}
		return ownedTickets;
	}
}
